    "Quận/Huyện",
    "Mã học sinh",
    "Lớp",
    "Họ và tên",
    "Ngày",
    "Tháng",
    "Năm",
    "Giới tính",
    "Nơi sinh",
    "Dân tộc",
    "Hộ khẩu thường trú",
    "Điện thoại liên hệ",
    "Tổng điểm năm lớp 1",
    "Tổng điểm năm lớp 2",
    "Tổng điểm năm lớp 3",
    "Tổng điểm năm lớp 4",
    "Tổng điểm năm lớp 5",
    "Tổng điểm kết quả 5 năm",
    "Điểm ưu tiên",
    "Tổng điểm sơ tuyển",
    "Ghi chú",
  ];

  //   const resultDataShow = {
